import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useHistory } from 'react-router'

export const LocationinCity = (props) => {
    const dispatch = useDispatch()
    const property = useSelector(state => state.property)
const history=useHistory()

    const del_laxmi = ()=>{
        var allItems = JSON.parse(JSON.stringify(props.fetchPropHeader));
        const sortedFetchPropertiesArray = allItems.sort((a, b) => a.flat_price > b.flat_price ? 1 : -1);
        // sortedFetchPropertiesArray[0].flat_price=10;
        props.setFetchProperties(sortedFetchPropertiesArray);



        dispatch({
            type:"SAVE_SELECTED_LOCATION",
             payload:{
                area:props.location
            }
        });


        history.push({
            pathname:"/propertylist",


              state:{
            //     area:props.location,
                reason:"Buyer/Owner",
               flat:"Flat/ Apartment"
            //     city:props.city

            }
        })


     }

    return (
       <>
        <li class="roundbtn"> 
       <button class="btn btn-outline-secondary" type="button" onClick={del_laxmi} >{props.location}</button>
       {/* <button class="btn btn-outline-secondary" type="button" onClick={del_laxmi} >{property?.selectedLocation?.area}</button> */}

       </li>
       </>
    )
}
